It is estimated that about half of the variation in homicide rates can been accounted for by the following factors:
1. The number of victims;
2. The number of offenders;
3. The length of time the victim was injured;
4. The nature of the injury;
5. The cost of the injury;
6. The cost of rehabilitation;
7. The stigma attached to the crime;
8. The level of violence in the community;
9. The social and economic conditions in which the crime was committed;

